import React, { useState } from 'react';
import spdf from "simple-react-pdf";
import styles from "assets/jss/material-kit-react/views/componentsSections/tabsStyle.js";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(styles);

export default function ExperienceSection() {
  const classes = useStyles();
  const state = {
    numPages: null,
    pageNumber: 1,
  }

  onDocumentLoadSuccess = ({ numPages }) => {
    this.setState({ numPages });
  }
  const { pageNumber, numPages } = this.state;
  return (
    <div style={{backgroundColor:"white"}} className={classes.section}>
      <div  className={classes.container}>
        <div  id="navigation-pills">
          <div className={classes.title}>
            <h1 >Experience</h1>
            <hr  style={{borderTop:"1px solid #bbb", borderRadius:"5px"}}/>
          </div>
          <div >
          <h2 style={{paddingTop:"50px"}}>Check out my Linkedin:</h2>
          <div class="LI-profile-badge"  data-version="v1" data-size="large" data-locale="en_US" data-type="vertical" data-theme="dark" data-vanity="tanishqsandhu"><a class="LI-simple-link" href='https://www.linkedin.com/in/tanishqsandhu?trk=profile-badge'>Tanishq Sandhu</a></div>          </div>
        </div>
        <div>
        </div>
      </div>
    </div>
  );
}
